import React, { Component } from 'react';
import Header from './header';
class layout extends Component {
    // state = {  }
    render() { 
        return ( 
            <div>
                <Header/>
                {this.props.children}
                <h1>im a footer</h1>
            </div>
        );
    }
}
 
export default layout;
